### YamlMime:UniversalReference
api_name: []
items:
- attributes:
  - description: Output only. A hash of this resource.
    id: etag
    var_type: str
  - description: Required. Unique identifier for this model.
    id: model_reference
    var_type: <xref uid="google.cloud.bigquery_v2.types.ModelReference">google.cloud.bigquery_v2.types.ModelReference</xref>
  - description: "Output only. The time when this model was\n   created, in millisecs\
      \ since the epoch."
    id: creation_time
    var_type: int
  - description: "Output only. The time when this model was\n   last modified, in\
      \ millisecs since the epoch."
    id: last_modified_time
    var_type: int
  - description: "Optional. A user-friendly description of this\n   model."
    id: description
    var_type: str
  - description: Optional. A descriptive name for this model.
    id: friendly_name
    var_type: str
  - description: "The labels associated with this model. You\n   can use these to\
      \ organize and group your models.\n   Label keys and values can be no longer\
      \ than 63\n   characters, can only contain lowercase letters,\n   numeric characters,\
      \ underscores and dashes.\n   International characters are allowed. Label\n\
      \   values are optional. Label keys must start with\n   a letter and each label\
      \ in the list must have a\n   different key."
    id: labels
    var_type: Mapping[str, str]
  - description: "Optional. The time when this model expires,\n   in milliseconds\
      \ since the epoch. If not present,\n   the model will persist indefinitely.\
      \ Expired\n   models will be deleted and their storage\n   reclaimed.  The defaultTableExpirationMs\n\
      \   property of the encapsulating dataset can be\n   used to set a default expirationTime\
      \ on newly\n   created models."
    id: expiration_time
    var_type: int
  - description: "Output only. The geographic location where\n   the model resides.\
      \ This value is inherited from\n   the dataset."
    id: location
    var_type: str
  - description: "Custom encryption configuration (e.g., Cloud\n   KMS keys). This\
      \ shows the encryption\n   configuration of the model data while stored in\n\
      \   BigQuery storage. This field can be used with\n   PatchModel to update encryption\
      \ key for an\n   already encrypted model."
    id: encryption_configuration
    var_type: <xref uid="google.cloud.bigquery_v2.types.EncryptionConfiguration">google.cloud.bigquery_v2.types.EncryptionConfiguration</xref>
  - description: Output only. Type of the model resource.
    id: model_type
    var_type: <xref uid="google.cloud.bigquery_v2.types.Model.ModelType">google.cloud.bigquery_v2.types.Model.ModelType</xref>
  - description: "Output only. Information for all training runs in increasing\n \
      \  order of start_time."
    id: training_runs
    var_type: Sequence[<xref uid="google.cloud.bigquery_v2.types.Model.TrainingRun">google.cloud.bigquery_v2.types.Model.TrainingRun</xref>]
  - description: "Output only. Input feature columns that were\n   used to train this\
      \ model."
    id: feature_columns
    var_type: Sequence[<xref uid="google.cloud.bigquery_v2.types.StandardSqlField">google.cloud.bigquery_v2.types.StandardSqlField</xref>]
  - description: "Output only. Label columns that were used to train this\n   model.\
      \ The output of the model will have a <code>predicted_</code>\n   prefix to\
      \ these columns."
    id: label_columns
    var_type: Sequence[<xref uid="google.cloud.bigquery_v2.types.StandardSqlField">google.cloud.bigquery_v2.types.StandardSqlField</xref>]
  - description: The best trial_id across all training runs.
    id: best_trial_id
    var_type: int
